import React from "react";
import * as C from "./styled";

const Header = ({ title, subtitle }) => {
  return (
    <C.Header>
      <C.Container_t>
        <C.Title>{title}</C.Title>
        {subtitle && <C.SubTitle>{subtitle}</C.SubTitle>}
      </C.Container_t>
    </C.Header>
  );
};

export default Header;
